contract PartsFlow {
    //
    uint256 public id; //ID
    address createrID; //ID
    string name; //
    string partsType; //
    string batch; //
    string note; //
    uint256[] procedures; //
    uint256[] formerparts; //ID

    constructor(
        uint256 _id,
        address _createrID,
        string memory _name,
        string memory _partsType,
        string memory _batch,
        uint256[] memory _formerparts,
        string memory _note
    ) {
        id = _id;
        createrID = _createrID;
        name = _name;
        partsType = _partsType;
        batch = _batch;
        formerparts = _formerparts;
        note = _note;
    }

    function attachProcedure(uint256 procedureID) public returns (bool) {
        procedures.push(procedureID);
        return true;
    }

    function checkPartsFlow()
        public
        view
        returns (
            address,
            string memory,
            string memory,
            string memory,
            string memory,
            uint256[] memory,
            uint256[] memory
        )
    {
        return (
            createrID,
            name,
            partsType,
            batch,
            note,
            procedures,
            formerparts
        );
    }
}
